import React from 'react';
import Navigation from '../components/Navigation';
import Projectlist from '../components/portfolio/Projectlist';

const Portfolio = () => {
    return (
        <div className='portfolio'>
            <Navigation />
            <Projectlist />
        </div>
    );
};

export default Portfolio;
